/*
 * Example of nested for loop 
 */
package com.loops;

public class NestedForDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,j;
		for(i=1;i<=5;i++)
		{
			for(j=1;j<=5;j++)
			{
				System.out.println(i+" "+j);
			}
			System.out.println( );
		}
	}

}
